def spherical_harmonic(l, m, xyz):
    return ylm_func_dict[(l, m)](xyz/np.linalg.norm(xyz, axis=-1)[...,None])

def get_multiplication_instructions(l1, m1, l2, m2):
    if l1 > l2:
        return ylm_yl2m2_dict[(l1, m1, l2, m2)]
    elif l2 > l1:
        return ylm_yl2m2_dict[(l2, m2, l1, m1)]
    elif m1 > m2:
        return ylm_yl2m2_dict[(l1, m1, l2, m2)]
    else:
        return ylm_yl2m2_dict[(l2, m2, l1, m1)]

def spherical_bessel(l, gr):
    if l == 0:
        result = np.ones_like(gr)
    else:
        result = np.zeros_like(gr)
    result[gr != 0] = bessel_dict[l](2 * np.pi * gr[gr != 0])
    #result[result > 1] = 0
    #result[result < -1] = 0
    return result
